tinymce.PluginManager.add("h3",function(e){e.addButton("h3",{text:"H3",icon:!1,onclick:function(){e.windowManager.open({title:"H3 Tag",body:[{type:"textbox",name:"title",label:"Title"}],onsubmit:function(t){e.insertContent("<div style='padding-bottom:10px;' class='av-special-heading av-special-heading-h3 meta-heading'><h3 class='av-special-heading-tag' itemprop='headline'>"+t.data.title+"</h3><div class='special-heading-border'><div class='special-heading-inner-border' ></div></div>")}})}})});